content.descrizione:
Lo scopo della presente proposta di legge è pertanto quello di provvedere forzatamente a
ridistribuire la popolazione degli orsi attualmente presente nella parte occidentale della provincia di Trent, che si stima essere pari a circa 32esemplari, su tutto l’arco alpino coinvolgendo i territori delle 5 regioni alpine.
Così facendo, potremo salvare gli orsi dalle ordinanze di abbattimento ed al contempo ridurre drasticamente la possibilità di incontri accidentali con gli esseri umani, garantendo così anche la serenità dei turisti e delle popolazioni locali.
- Di intesa ed in collaborazione con la provincia autonoma di Trento e della Regione Trentino, gli orsi attualmente presente in loco, verranno inventariati e muniti di radio collare entro il termine di 12 mesi dalla entrata i vigore delle presente legge.
- Terminata l’operazione di cui sopra, gli orsi verranno ridistribuiti sull’arco alpino, in coppia e più precisamente :
- Nr. 4 esemplari nella Regione Friuli Venezia Giulia;
- Nr. 8 esemplari nella Regione Veneto;
- Nr. 8 esemplari nella Regione Lombardia;
- Nr. 8 esemplari nella Regione Piemonte;
- Nr. 4 esemplari nella Regione Valle D’Aosta.
- Al censimento ed ai trasferimenti degli animali provvederà il Comando unità forestali, ambientali e agro alimentare dell’Arma dei Carabinieri, con mezzi e risorse proprie.
